import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';




const useStyles = makeStyles((theme) => ({
    table: {
      minWidth: 650,
    },
    tableau: {
        marginTop:"4%",
    },
    root: {
      flexGrow: 1,
      backgroundColor: theme.palette.background.paper,
    },
  }));


  function TabPanel(props) {
    const { children, value, index, ...other } = props;

    return (
      <div
        role="tabpanel"
        hidden={value !== index}
        id={`simple-tabpanel-${index}`}
        aria-labelledby={`simple-tab-${index}`}
        {...other}
      >
        {value === index && (
          <Box p={3}>
            <Typography>{children}</Typography>
          </Box>
        )}
      </div>
    );
  }

  TabPanel.propTypes = {
    children: PropTypes.node,
    index: PropTypes.any.isRequired,
    value: PropTypes.any.isRequired,
  };

  function a11yProps(index) {
    return {
      id: `simple-tab-${index}`,
      'aria-controls': `simple-tabpanel-${index}`,
    };
  }



  const Tableau = (props)  =>  {
      const classes=useStyles();
      const [resultForm,setresult]=React.useState([]);


      React.useEffect(()=>{
        console.log(props.updateurl);
        fetch(props.updateurl)
        .then(response => response.json())
        .then(result => setresult(result))
        .catch(error => console.log('error', error));
        console.log(resultForm);

      },[props.updateurl]);

      return(
        <TableContainer component={Paper} className={classes.tableau}>

        <Table className={classes.table} size="small" aria-label="a dense table">
          <TableHead>
            <TableRow>
              <TableCell>Temps</TableCell>
              <TableCell >Profondeur</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>

              <TableRow>
                <TableCell >{resultForm.paliers.map}</TableCell>
              </TableRow>

          </TableBody>
        </Table>
      </TableContainer>
      );

  }

  export default Tableau;
